import client from '../../client.js'

const TestimonialSection = () => {
    var pup;
    // fetching the data
    client
    .fetch('*[_type == "puppy"]', {})
    .then(res => pup = res)
    .then(pup => console.log(pup))
    .catch(err => {
    console.log(err)
    })
    return (
        <article>
            <h1>pup</h1>
        </article>
    )
}

export default TestimonialSection
